@st.cache_resource
def load_model():
    """Loads and returns the trained model if available, else returns None."""
    if not os.path.exists(MODEL_PATH):
        return None
    try:
        return tf.keras.models.load_model(MODEL_PATH)
    except Exception as e:
        st.error(f"‚ùå Error loading model: {e}")
        return None

def preprocess_image(image):
    """Preprocesses an image for model prediction."""
    img = np.array(image)  # Convert PIL image to numpy array
    img = cv2.resize(img, (150, 150))
    img = img.astype('float32') / 255.0
    return np.expand_dims(img, axis=0)  # Add batch dimension

def decode_prediction(prediction):
    """Decodes model predictions into a readable string."""
    return ''.join([CHAR_LIST[i] for i in np.argmax(prediction, axis=-1) if i < len(CHAR_LIST)]).strip()

# UI Components
st.title("‚úçÔ∏è Handwriting Recognition")
st.write("Upload an image with handwritten text, and we'll extract it for you!")

uploaded_file = st.file_uploader("üìÇ Upload an image", type=["jpg", "png", "jpeg"])

# Load the model once
model = load_model()

if uploaded_file:
    try:
        image = Image.open(uploaded_file)
        st.image(image, caption="üñºÔ∏è Uploaded Image", use_container_width=True)

        if model:
            try:
                prediction = model.predict(preprocess_image(image))
                predicted_text = decode_prediction(np.squeeze(prediction))
                st.subheader(f"üîç Predicted Text: `{predicted_text}`")
            except Exception as e:
                st.error(f"‚ö†Ô∏è Error during prediction: {e}")
        else:
            extracted_text = pytesseract.image_to_string(image).strip()
            if extracted_text:
                st.subheader(f"‚úÖ Prescription Prediction: `{extracted_text}`")
            else:
                st.warning("‚ùó No text detected.")
    except Exception as e:
        st.error(f"‚ö†Ô∏è Error: Unable to process image. {e}")

    